import React, {useState, useEffect} from 'react';
/*
const TweetsList = ({tweets}) => (
    <>
    <h3>Tweets</h3>
    {tweets.map((tweet, key) => (
        <div key={key}>
            <h4>{tweet.data}</h4>
        </div>
    ))}
    </>
) */

const ArticlePage = () => {
    const [tweetInfo, setTweetInfo] = useState({});
    useEffect(() => {
        setTweetInfo({text: 'this is a tweet'});
    })
    
    return(
        <>
        <p>Tweets:</p> 
        <p>{tweetInfo.data}</p>
        </>
    )
}
